import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div >
      <BrowserRouter>
        <Routes>

          <Route path="/" element={<><Header /><Home /><Footer /></>}></Route>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
